inline functions make sense to be used if they are higher-order functions. inline is copy-and-paste. Inline classes will use the value modifier. Use @JvmInline for java backends. const for compile-time constants. These are read-only properties (so it's will always be const val) that must be initialised with a primitive type or String type. Declaration is done either at top-level, member of an object declaration, or a companion object. reified for generic types, so that the type information is available during runtime. This directive is used together with the inline function. Java's solution for this is very verbose. fun <T: Any> doSomething(value: T, type: KClass<T>) { println("Doing something with type: ${type.simpleName}") // OK
} but Kotlin handles it better: inline fun <reified T> doSomething(value: T) { println("Doing something with type: ${T::class.simpleName}") // OK
